import React from 'react';
// import './css/style.css';


function MakeSponsor(props) {
	return (
		<div className={props.position}>
			<a
	        	href={props.url}
				// target="_blank"
	        >
			<img
				className={props.className}
				src={props.logo}
			/>
			</a>
		</div>
	);
}

//Diamond Row
class DiamondRow extends React.Component {
	constructor(props) {
		super(props);

	}

	renderSponsor(p,u,c,l) {
		return(
			<MakeSponsor
				position={p}
				url={u}
				className={c}
				logo={l}
			/>
		);
	}

	render() {
		return(
			<div className="col-sm-4 TRowePos">
		            {this.renderSponsor("https://www3.troweprice.com/usis/corporate/en/home.html",
		            					"img-fluid TRoweLogo",
		            					"../img/sponsors/TRowe.png")
		        	}
			</div>
		);
	}

}


// Final Render
class Sponsor extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			title: "Sponsors",
			open_bracket: "{ ",
			close_bracket: " }"
		}
	}

	renderSponsor(u,c,l) {
		return(
			<MakeSponsor
				url={u}
				className={c}
				logo={l}
			/>
		);
	}
	render() {
		return(
			<div className="wrapper">
		        <h1 className="section-header-gray">
		          <span className="bracket-color">{this.state.open_bracket}</span> {this.state.title}
		          <span className="bracket-color">{this.state.close_bracket}</span>
		        </h1>
		        <br />
		        <div className="row sponsors">
		            {this.renderSponsor("col-sm-4 TRowePos", //Positioning
		            					"https://www3.troweprice.com/usis/corporate/en/home.html", //Url
		            					"img-fluid TRoweLogo", //Logo size
		            					"../img/sponsors/TRowe.png") //Path to Logo
		        	}
		        </div>
		     </div>
     );
 }
}

export default Sponsor;
// export default SponsorPage;
